MatterTitle:
Resolution approving the decision of the City Planning Commission on ULURP No. M 050272 ZMK (L.U. No. 617), for the modification of a Restrictive Declaration, to facilitate the development of a storage facility (UG 16) in C7 and C3 Districts, Brooklyn.
 ..Body

By Council Members Katz and Avella


     	WHEREAS, the City Planning Commission filed with the Council on October 21, 2005 its decision dated October 19, 2005 (the "Decision") on the application submitted by Knapp Street Entertainment Center, Inc., for the modification of a Restrictive Declaration, which was previously approved in connection with an application for a Zoning Map amendment (CP-21725), to remove Block 8833, Lot 200, from among the properties subject to the conditions of the Declaration to facilitate the development of a storage facility (Use Group 16) on property located at 2461 Knapp Street (Block 8833, Lot 200), in C7 and C3 Districts, Community District 15, Borough of Brooklyn (ULURP No. M 050272 ZMK) (the "Application");

	WHEREAS, the Decision is subject to review and action by the Council pursuant to Section 197-d(b)(1) of the City Charter;

   	WHEREAS, the subject application is a request by Knapp Street Entertainment Center, Inc., to modify a Restrictive Declaration as it relates to Tax Block 8833, Lot 200 so as to permit an alternative development;

      	WHEREAS, upon due notice, the Council held a public hearing on November 14, 2005 on the Decision and Application;

      	WHEREAS, the Council has considered the relevant environmental issues and the Negative Declaration issued on May 5, 2005 (CEQR No. 05BSA079K);

      	WHEREAS, the Council has considered the land use implications and other policy issues relating to the Decision and Application;
     	       	       	       	       	       	       		
RESOLVED:

The Council finds that the action described herein will have no significant effect on the environment.
_______

      	Pursuant to Sections 197-d and 200 of the New York City Charter and on the basis of the Decision and Application, the Council approves the Decision.


Adopted.


